<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        * {
            padding: 0;
            margin: 0;
        }

        .container {
            margin: 20px auto 0 auto;
            font-size: 0;
            width: 500px;
            height: 500px;
            border: black 1px solid;
        }

        .container>div {
            display: inline-block;
            width: 10px;
            height: 10px;
            border: gray 1px solid;
            box-sizing: border-box;
        }

        .console {
            width: 300px;
            height: 80px;
            margin: 30px auto 0 auto;
        }

        .console div {
            height: 100%;
            display: flex;
            justify-content: space-around;
            align-items: center;
            user-select: none;
        }

        .console div>button {
            border: none;
            width: 80px;
            height: 40px;
            color: white;
            font-weight: bold;
            border-radius: 10px;
            cursor: pointer;
        }

        .console div>button:focus { outline: none; }

        button:nth-child(1) { background: rgb(29, 78, 118); }
        button:nth-child(2) { background: rgb(230, 65, 44); }
        button:nth-child(3) { background: rgb(195, 148, 7); }

        .console button:nth-child(1):active { background: rgba(29, 78, 118, 0.73); }
        .console button:nth-child(2):active { background: rgba(230, 65, 44, 0.73); }
        .console button:nth-child(3):active { background: rgba(195, 148, 7, 0.73); }
        
    </style>
</head>
